import React from 'react';
import "./about.css";
import profile from "../../assets/profile.jpg";
import Info from './Info';



const About = () => {
    return (
        <section className="about section" id="about">
            <h2 className="section__title">About Me</h2>
            <span className="section__subtitle">
                More Explanations AboutMe
            </span>
            <div className="about__container container grid">
                <img src={profile} nalt="" className='about_img'/>
             <div className="about__data">
                <Info />
                <p className="about__description">
                    Backend developer, experienced with more frameworks and familiar with almost all databases, even clients are excited with projects carried out.
                </p>
             </div>
            </div>
        </section>
    )
}

export default About
